import React from 'react';
import '../../css/home-page/products.css';

export default function Product () {
    let final = '';
    async function getProducts() {
        let result = await fetch('https://my-json-server.typicode.com/tdmichaelis/json-api/products');
        let object = await result.json();

        object.map(Product => {
            final += `<div class='Product'>
            <div class='Image'><img src={'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/6211/6211009_sd.jpg'}/></div>
            <div class='Body'>
                <div class='Title'>Toshiba - 49” Class – LED - 1080p</div>
                <div class='Description'>Toshiba HDTV Fire TV Edition is a new generation of smart TVs featuring the Fire TV experience built-in and including a Voice Remote with Alexa.</div>
                <div class='Ratings'>
                    <div class='Input'>
                        <div class='Price'>$199.99</div>
                        <div class='Stars'>4.6</div>
                    </div>
                    <button>Add to Cart</button>
                </div>
            </div>
        </div>`
        });


    }

    getProducts().then(r => null);

    return (
        <div className={'Product'}>
            <div className={'Image'}><img src={'https://pisces.bbystatic.com/image2/BestBuy_US/images/products/6211/6211009_sd.jpg'}/></div>
            <div className={'Body'}>
                <div className={'Title'}>Toshiba - 49” Class – LED - 1080p</div>
                <div className={'Description'}>Toshiba HDTV Fire TV Edition is a new generation of smart TVs featuring the Fire TV experience built-in and including a Voice Remote with Alexa.</div>
                <div className={'Ratings'}>
                    <div className={'Input'}>
                        <div className={'Price'}>$199.99</div>
                        <div className={'Stars'}>4.6</div>
                    </div>
                    <button>Add to Cart</button>
                </div>
            </div>
        </div>
    )

}
